<template>
	<view class="informantion_mask" @tap="shouldClose ? closeWindow : null">
		<view class="informantion_content" @tap.stop.prevent>
			<view class="mask_header">
				<image v-show="isForceUpdate" class="close_btn" src="../../static/images/close_update_popup.png" mode="aspectFit" @click="handleCloseExitApp"></image>
			</view>
			<view v-show="isForceUpdate" class="informantion_content_noshowCancel_n">
				<view class="informantion_title_n">
					<text class="informantion_title_p_n">{{ options.title }}</text>
					<scroll-view class="informantion_title_span_n" scroll-y="true">
						<text v-html='options.content'></text>
					</scroll-view>
				</view>
				<view class="informantion_btn_n">
					<button class="informantion_btn_confirm_n" @tap="confirmUpdate">
						{{ $t("updateCode.update_now") }}
					</button>
				</view>
			</view>
			<view v-show="!isForceUpdate" class="informantion_content_showCancel">
				<view class="informantion_title">
					<text class="informantion_title_p">{{ options.title }}</text>
					<scroll-view class="informantion_title_span" scroll-y="true">
						<text v-html='options.content'></text>
					</scroll-view>
				</view>
				<view class="informantion_btn_yes">
					<button class="informantion_btn_confirm_yes" @tap="confirmUpdate">
						{{ $t("updateCode.update_now") }}
					</button>
					<button type="default" class="informantion_btn_cancel_yes" @tap="cancelUpdate">
						{{ $t("updateCode.cancel_Text") }}
					</button>
				</view>
			</view>
		</view>
	</view>
</template>

<script>
export default {
	data() {
		return {
			isForceUpdate: false,
			shouldClose: false,
			options: {},
			backButtonPress: 0,
		}
	},
	onLoad(options) {
		this.options = options;
		if (options.isForceUpdate == 1) {
			this.isForceUpdate = true;
		} else {
			this.isForceUpdate = false;
		}
		// ios禁用左滑
		// #ifdef APP-PLUS
		var page = this.$mp.page.$getAppWebview();
		page.setStyle({ popGesture: 'none' });
		// #endif
	},
	// 安卓左滑
	onBackPress(options) {
		this.backButtonPress++;
		if (this.backButtonPress > 1) {
			plus.runtime.quit();
		} else {
			plus.nativeUI.toast('Press again to exit the application');
		}
		const self = this;
		setTimeout(function () {
			self.backButtonPress = 0;
		}, 1000);
		// 阻止默认返回行为
		return true;
	},
	methods: {
		// 强更新退出app按钮
		handleCloseExitApp(){
			switch (uni.getSystemInfoSync().platform) {
				case 'android':
					plus.runtime.quit();
				break;
				case 'ios':
					plus.ios.import('UIApplication').sharedApplication().performSelector('exit');
				break;
			}
		},
		// 打开更新链接
		confirmUpdate() {
			const platform = uni.getSystemInfoSync().platform;
			// H5调试
			if (typeof plus === "undefined") {
				const urls = this.options.downloadLink.replace("itms-appss:", "https:");
				setTimeout(() => {
					window.location.href = urls;
				}, 500);
			} else {
				// 真机环境
				if (platform === "ios") {
					plus.runtime.launchApplication({ action: this.options.downloadLink }, (e) => {
						console.log("Failed to open the default browser: " + e.message);
					});
				} else {
					plus.runtime.openURL(this.options.downloadLink);
				}
			}
			//强更
			if(this.isForceUpdate){
				this.$trackEvent.app_force_update();
			} else {
				this.$trackEvent.app_update();
			}
		},
		cancelUpdate() {
            const currentTime = new Date().getTime();
			uni.setStorageSync('appLastPopupTime', currentTime);
			uni.switchTab({
				url: '/pages/index/index'
			});
			this.$trackEvent.app_update_cancel();
		},
		closeWindow() {
			this.cancelUpdate()
		}
	}
}
</script>

